sys_variable_value.value:
(function parse(inputs, outputs) {
    var xmlDoc = new XMLDocument2();
     xmlDoc.parseXML(inputs.sourceItem);
     outputs.targetObject.LoadBalancerArn= xmlDoc.getNodeText('/member/LoadBalancerArn');
     outputs.targetObject.DNSName= xmlDoc.getNodeText('/member/DNSName');
     outputs.targetObject.Type= xmlDoc.getNodeText('/member/Type');
     outputs.targetObject.LoadBalancerName= xmlDoc.getNodeText('/member/LoadBalancerName');
     outputs.targetObject.CanonicalHostedZoneId= xmlDoc.getNodeText('/member/CanonicalHostedZoneId');
     outputs.targetObject.CreatedTime= xmlDoc.getNodeText('/member/CreatedTime');
     outputs.targetObject.State= xmlDoc.getNodeText('/member/State/Code');
     var temp2 = gs.xmlToJSON(xmlDoc.getDocumentElement());
     if(temp2.member.AvailabilityZones.member instanceof Array)
     outputs.targetObject.AvailabilityZones = temp2.member.AvailabilityZones.member;
     else
     {
       var temp =[temp2.member.AvailabilityZones.member];
       outputs.targetObject.AvailabilityZones =  temp;
     }
})(inputs, outputs)

